import React, { Component } from 'react'

export default class servicesMenu extends Component {
	render() {
		return (
			<>
				<div className='container common-container-wdt'>
					<div className='provide-services'>
						<h4>Engineering</h4>
						<ul>
							<li>Web Apps Development</li>
						</ul>
					</div>
				</div>
			</>
		)
	}
}
